import { faSearch } from '@fortawesome/free-solid-svg-icons';
import './_Filters.scss';
import { FormControl, InputLabel, MenuItem, Select } from '@mui/material';
import FormInput from '../Form/FormInput';
import DropDown from '../Form/Dropdown';

const Filters: React.FC = () => {
    const dummyCity = [
        'Vilnius',
        'Kaunas',
        'Klaipėda'
    ];

    return (
        <div className='filters-container'>
            <h3>Filtrai</h3>
            <FormInput 
                placeholder='Paieška..'
                type='text'
                icon={faSearch}
                styling={{
                    container: 'filters-input-wrapper',
                    input: 'filters-input',
                    icon: 'filters-input-icon'
                }}
            />
            <DropDown
                styling='filters-input-wrapper'
                label='Miestas'
                defaultValue='Pasirinkite miestą...'
                menuItems={dummyCity}
            />

            <div className='filters-input-wrapper'>
                <FormControl fullWidth>
                    <InputLabel id="demo-simple-select-label">Miestas</InputLabel>
                    <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        value={''}
                        label="Kazkas"
                    >
                        <MenuItem value="">Pasirinkite miestą...</MenuItem>
                        <MenuItem value={'Vilnius'}>Vilnius</MenuItem>
                        <MenuItem value={'Kaunas'}>Kaunas</MenuItem>
                        <MenuItem value={'Klaipėda'}>Klaipėda</MenuItem>
                    </Select>
                </FormControl>
            </div>
        </div>
    );
}

export default Filters;
